            </form>

        </div>
    );
}
function Searchvideo(){
    let x = "&nbsp"
    return(
        <div>
            <label>Search: {x}</label>
            <input type="text" class="searchVideo"name="search" value></input>
        </div>
    );
}
function Selectvideo(){
    return (
    <div>
        <label>Select video</label>
        <select>Select Video</select>

    </div>);
}



export default function Search(){
    return (
        <div class="search" >
            <Uploadvideo />
            <Searchvideo />
            <Selectvideo />
        </div>
    );
}
